			"title": "Feat/Fix to mitigate bugs when you have different usernames on different computers",
			"user": {
				"login": "mmorenoregalado",
				"id": 51204523,
				"node_id": "MDQ6VXNlcjUxMjA0NTIz",
				"avatar_url": "https://avatars.githubusercontent.com/u/51204523?v=4",
				"gravatar_id": "",
				"url": "https://api.github.com/users/mmorenoregalado",
				"html_url": "https://github.com/mmorenoregalado",
				"followers_url": "https://api.github.com/users/mmorenoregalado/followers",
				"following_url": "https://api.github.com/users/mmorenoregalado/following{/other_user}",
				"gists_url": "https://api.github.com/users/mmorenoregalado/gists{/gist_id}",
				"starred_url": "https://api.github.com/users/mmorenoregalado/starred{/owner}{/repo}",
				"subscriptions_url": "https://api.github.com/users/mmorenoregalado/subscriptions",
				"organizations_url": "https://api.github.com/users/mmorenoregalado/orgs",
				"repos_url": "https://api.github.com/users/mmorenoregalado/repos",
				"events_url": "https://api.github.com/users/mmorenoregalado/events{/privacy}",
				"received_events_url": "https://api.github.com/users/mmorenoregalado/received_events",
				"type": "User",
				"site_admin": false
			},
			"body": "### Description\r\n\r\nUse $HOME variable when defining $DOTFILES_PATH in .zshenv file when first installing dotly to mitigate bugs when you have different usernames on different computers\r\n\r\n### Motivation\r\n\r\nAt work they gave me a mac mini already configured with a username, there I started creating dotfiles and installing dotly, recently I bought a mac for me and installing dotly, when I imported my dotfiles, the username in .zshenv was different for what it launched an error since on my computer I had a username and another at work. I solved it easily by changing in .zshenv the variable /Users/nameuser/.dotfiles for $ HOME / .dotfiles\r\n\r\nAt the beginning of the error and newbie using dotly scared me a lot XD\r\n\r\nIt's easy to fix, but I think maybe it would be good if it was added in the .zshenv file when installing if the path is the default one.\r\n",
